import React, { Component } from "react";
import { Grid, Cell } from "react-mdl/lib/Grid";

class Landing extends Component {
	render() {
		return (
			<div style={{ width: "100%", margin: "auto" }}>
				<Grid >
					<Cell col={12}></Cell>
				</Grid>
			</div>
		);
	}
}

export default Landing;
